import Navbar from "./Navbar"
import { store } from "../features/store"
import { useSelector } from "react-redux"
import Departament from "./Departament"

function Departamente(){
    const currentUser = useSelector(state => store.getState().user)
    return(
        <>
            <Navbar />
            <h1>Pentru ce departament vrei sa oferi feedback?</h1>
            <div>
                {currentUser.first_department && <Departament name={currentUser.first_department}/>}
                {currentUser.second_department && <Departament name={currentUser.second_department}/>}
                {currentUser.third_department && <Departament name={currentUser.third_department}/>}
            </div>
        </>
    )
}

export default Departamente
